import React from 'react';

class App extends React.Component {
  state = {
    name: 'cx',
    age: 16
  }
  onClick = (a, e) => {
    this.setState({
      name: a,
      age: e.target.value
    })
  }
  render() {
    return (
      <div className="App">
        <div>{this.state.name}</div>
        <div>{this.state.age}</div>
        <button onClick={(e) => this.onClick('cxnb', e)} value='6666'>修改</button>
        <Greeting name='6666'/>
        <Greeting name='6666'/>
        <Greeting name='6666'/>
      </div>
    );
  }
}

class Greeting extends React.Component {
  render() {
    return (
      <div>
        <h1>{this.props.name}</h1>
